   326→        <p><b>Temporal debt</b> is a theoretical framework in <a href="/wiki/Chronopsychology">chronopsychology</a> describing the accumulated deficit that occurs when an individual consistently borrows perceived time from future experiences to extend present moments. First formalized by Dr. Helena Voss at the <a href="prague-institute-for-liminal-studies.html">Prague Institute for Liminal Studies</a> in 1987, the concept has since found applications in fields ranging from <a href="/wiki/Productivity">productivity science</a> to <a href="/wiki/Quantum_mechanics">quantum mechanics</a>.<sup><a href="#cite1">[1]</a></sup></p>
   327→
   328→        <p>Unlike <a href="/wiki/Technical_debt">technical debt</a> in software engineering, temporal debt cannot be "paid off" through future effort. Instead, it compounds according to what Voss termed the <b>Law of Chronological Interest</b>, wherein each borrowed moment requires exponentially more subjective time to repay.<sup><a href="#cite2">[2]</a></sup></p>
